import React from "react";

const Banner = () => {
  return (
    <div className="page-container relative h-[350px] rounded-lg mt-8">
      <div className="overlay absolute inset-0"></div>
      <img
        className="w-full h-full object-cover rounded-lg"
        src="https://getwallpapers.com/wallpaper/full/4/c/1/1110427-full-size-the-avenger-wallpaper-hd-1920x1080-desktop.jpg"
        alt=""
      />
      <div className="absolute top-[50%]">
        <h2 className="text-white text-4xl font-bold ">Avengers: Endgame</h2>
        <div className="movie__type flex items-center justify-center">
            <span>Action</span>
        </div>
      </div>
    </div>
  );
};

export default Banner;
